import React from 'react'

import { Outlet } from "react-router-dom";
import Dropdown from "react-bootstrap/Dropdown";
import DropdownButton from "react-bootstrap/DropdownButton";

const Menu = () => {
  return (
    <div className="menuDropdown">
      <DropdownButton variant="third" id="dropdown-item-button">
        <Dropdown.Item className="menuBtn" as="button">O nas</Dropdown.Item>
        <Dropdown.Item className="menuBtn" as="button">Kalendarz</Dropdown.Item>
        <Dropdown.Item className="menuBtn" as="button">Ustawienia konta</Dropdown.Item>
        <Dropdown.Item className="menuBtn" as="button">Pomoc</Dropdown.Item>        
      </DropdownButton>         
    </div>        
  );
};

export default Menu;
